var setWidth = function setWidth(id) {
  var w = jQuery('#master_width').width();
  var myWidth = 1600;

  if (w < 750) {
    myWidth = Math.floor(w * 0.95) - 50;
  } else if (w < 1200) {
    myWidth = Math.floor(w * 0.98) - 100;
  } else if (w < 1600) {
    myWidth = Math.floor(w * 0.96) - 120;
  }

  return myWidth;
};

